import ExpenseItem from './components/ExpenseItem';
import ExerciseComponent from './components/ExerciseComponent';

function App() {
	const data = [
		{
			title: 'Car',
			amount: 12,
		},
		{
			title: 'Book',
			amount: 19.23,
		},
		{
			title: 'Laundry',
			amount: 5,
		},
	];
	return (
		<div>
			<h1>Let's get started!</h1>
			<p>Practicing React...</p>

			<ExerciseComponent></ExerciseComponent>
		</div>
	);
}

export default App;
